import './App.css';
import Home from './Component/Home';
import Navbar from './Component/Navbar';

function App() {
  return (
    <div>
      <BrowserRouter>
      <Router>
    <Navbar/>
    <Home/>
    </Router>
    </BrowserRouter>
    </div>
  );
}

export default App;
